(11, 'steam:110000116e56b24', 'Beta', 'DeWolf', '03/19/1998', 'Beta comes from a strict family sometimes wanting to open up to people around her but still hearing what she once heard from her family, she may come off as giddy but sometimes rude if she feels attacked. Her goal in life is as any other persons, have a great job, a home and someone to support her mostly someone cause she hasn\'t had much luck with that.', 'notset', '', -1, '', 0, 122, 5000, '-892841148', '[{\"index\":0,\"pallette\":0,\"drawable\":0,\"type\":\"drawable\",\"name\":\"head\",\"texture\":0},{\"index\":1,\"pallette\":0,\"drawable\":0,\"type\":\"drawable\",\"name\":\"beard\",\"texture\":0},{\"index\":2,\"pallette\":0,\"drawable\":0,\"type\":\"drawable\",\"name\":\"hair\",\"texture\":0},{\"index\":3,\"pallette\":0,\"drawable\":0,\"type\":\"drawable\",\"name\":\"torso\",\"texture\":0},{\"index\":4,\"pallette\":0,\"drawable\":0,\"type\":\"drawable\",\"name\":\"legs\",\"texture\":0},{\"index\":5,\"pallette\":0,\"drawable\":0,\"type\":\"drawable\",\"name\":\"hands\",\"texture\":0},{\"index\":6,\"pallette\":0,\"drawable\":0,\"type\":\"drawable\",\"name\":\"feet\",\"texture\":0},{\"index\":7,\"pallette\":0,\"drawable\":0,\"type\":\"drawable\",\"name\":\"necklace\",\"texture\":0},{\"index\":8,\"pallette\":0,\"drawable\":0,\"type\":\"drawable\",\"name\":\"accessories1\",\"texture\":0},{\"index\":9,\"pallette\":0,\"drawable\":0,\"type\":\"drawable\",\"name\":\"accessories2\",\"texture\":0},{\"index\":10,\"pallette\":0,\"drawable\":0,\"type\":\"drawable\",\"name\":\"decals/mask\",\"texture\":0},{\"index\":11,\"pallette\":0,\"drawable\":0,\"type\":\"drawable\",\"name\":\"torso2\",\"texture\":0},{\"index\":0,\"prop\":-1,\"type\":\"prop\",\"name\":\"helmet\",\"texture\":-1},{\"index\":1,\"prop\":-1,\"type\":\"prop\",\"name\":\"glasses\",\"texture\":-1},{\"index\":3,\"prop\":-1,\"type\":\"prop\",\"name\":\"ear accessories\",\"texture\":-1}]', '[]', '[]', 0, 0),
(12, 'steam:11000010d6cb762', 'Ella', 'Winham', '8/8/1998', 'Age: 19\n\nAppearance: Snow-White Hair, Pale freckled skin & Cold-Blue eyes. \n\nBirthday: 08/08/1998\n\nFirst Language: English (British)\n\nFavourite Colour: Black & White\n\nFavourite Things: Ocean, Guns, Strawberry Milkshakes, Her Dog (Alfie), Motorbikes.\n\nFamily Members: Mother (Claire Winham) Deceased, Father (Erik Winham) Deceased \n\nPersonality/Attitude: Ella is a very distant and cold individual, recent events have caused her to become slightly insane. At the mention of a single word, her attitude changes instantly from an innocent, dumbfounded child to a heartless cold killer; She very much so acts like a pet or a zombie as some would call it around her previous partner Dante, she follows his every command and does as he orders.  After talking to Nade she hasn\'t changed her ways but has more, put on a mask still staying loyal to Dante but protecting herself until she knows his true intentions. After Dante Died she became distant, still holding the mask to her face and pretending she was okay to please others around her.\n\nSkills: Mechanical skills, Drawing, Shooting, Driving\n\nDislikes: Mushrooms, Fish.\n\nStrengths: Shooting, Loyalty, Reliable. \n\nWeaknesses: Overly Emotional, Self-esteem, Verbal Communication. \n\nBackground Story: Ella Grew up in Southern England with her Mother & Father, about two months after her birth her father passed away in a tragic car accident, causing Ella to grow up wondering who her father was; She never knew what happened to her father and never intended to know.  17 years later, Ella signed up for University abroad in America, during this time her mother opened up & revealed what happened to her father; distraught Ella locked herself away like a brooding child till the day she had to leave for University.\n\nWhat happened to cause such a drastic change in El\'s personality? She was tortured and manipulated by the one and only Dante Evans, he kidnapped her as he then used shock therapy on her, sending massive surges of electricity to the brain causing multiple seizures, drastic memory loss & Psychosis as well as a split personality disorder.', 'notset', '', 872875, '', 0, 0, 15000, '-1667301416', '[{\"pallette\":0,\"name\":\"head\",\"index\":0,\"texture\":0,\"type\":\"drawable\",\"drawable\":21},{\"pallette\":0,\"name\":\"beard\",\"index\":1,\"texture\":0,\"type\":\"drawable\",\"drawable\":0},{\"pallette\":1,\"name\":\"hair\",\"index\":2,\"texture\":1,\"type\":\"drawable\",\"drawable\":15},{\"pallette\":0,\"name\":\"torso\",\"index\":3,\"texture\":0,\"type\":\"drawable\",\"drawable\":3},{\"pallette\":2,\"name\":\"legs\",\"index\":4,\"texture\":2,\"type\":\"drawable\",\"drawable\":20},{\"pallette\":0,\"name\":\"hands\",\"index\":5,\"texture\":0,\"type\":\"drawable\",\"drawable\":9},{\"pallette\":0,\"name\":\"feet\",\"index\":6,\"texture\":0,\"type\":\"drawable\",\"drawable\":3},{\"pallette\":0,\"name\":\"necklace\",\"index\":7,\"texture\":0,\"type\":\"drawable\",\"drawable\":3},{\"pallette\":0,\"name\":\"accessories1\",\"index\":8,\"texture\":0,\"type\":\"drawable\",\"drawable\":44},{\"pallette\":0,\"name\":\"accessories2\",\"index\":9,\"texture\":0,\"type\":\"drawable\",\"drawable\":14},{\"pallette\":0,\"name\":\"decals/mask\",\"index\":10,\"texture\":0,\"type\":\"drawable\",\"drawable\":0},{\"pallette\":0,\"name\":\"torso2\",\"index\":11,\"texture\":0,\"type\":\"drawable\",\"drawable\":189},{\"name\":\"helmet\",\"index\":0,\"prop\":12,\"type\":\"prop\",\"texture\":0},{\"name\":\"glasses\",\"index\":1,\"prop\":-1,\"type\":\"prop\",\"texture\":-1},{\"name\":\"ear accessories\",\"index\":3,\"prop\":-1,\"type\":\"prop\",\"texture\":-1}]', '{\"panini\":{\"amount\":1,\"display_name\":\"Panini\"},\"phone\":{\"amount\":1,\"display_name\":\"Phone\"}}', '[]', 0, 0),
