(177, 'steam:110000100df75d0', 'Johnny ', 'Spitiri', '17/11/1976', 'Johnny is an illegal immigrant hailing from Newcastle, Australia, he came over on a friends bucks party and just never left.\nJohnny is a very troubled guy, grew up the son of two parents both who where drug addicted and abusive, Johnny left home as soon as he turned 16 and broke contact with his parents.\n\nJohnny when coming to America years later, was amazed by the excess that people lived there lives in the city, he already had his battles with drugs but was somewhat clean by the time of the trip.\nBut, his will was only so strong, he got a taste of the crazy life and somewhere through the week long bucks party, he disappeared from his friends group and never went back.\n\nJohnny has spent the last 5 years of his life, chasing drugs and alcohol, fuelling his addictions with petty crimes and begging, he has dreams of getting clean and making something of himself, but just can\'t seem to get out of his own way.', 'notset', '{}', -1, '{}', 0, 500, 5000, '1885233650', '[]', '[]', '[]', 0, 0),
