(272, 'steam:1100001338b7fe5', 'Alex', 'Wexler', '10/4/1970', 'Alex Wexler is a former Marine that served 3 tours in Iraq and 1 tour in Afghanistan. He was dishonorably discharged after getting caught up in a gun running scheme while on Afghanistan. His defense was that he was ordered to by his battalion commander, but the jury wasn\'t swayed by that. He spent 10 years in prison and lost all of his pension and benefits after serving 15 years. He earned a silver star and a Marine Corps Commendation medal during his time in the military. He relocated to Los Santos after being released from Leavenworth. He\'s down on his luck and willing to do most jobs to survive. He has a disdain for authority and doesn\'t like to abide by the rules. He has an affinity for fast cars and enjoys the adrenaline rush it provides. He is all about getting the job done, no matter what. Which has served him well, but also gotten him into trouble in the past. He loves women and indulges whenever possible without getting too involved with them. ', 'notset', '{}', -1, '{}', 0, 500, 5000, '1885233650', '[{\"type\":\"drawable\",\"texture\":0,\"drawable\":43,\"index\":0,\"pallette\":0,\"name\":\"head\"},{\"type\":\"drawable\",\"texture\":1,\"drawable\":4,\"index\":1,\"pallette\":0,\"name\":\"beard\"},{\"type\":\"drawable\",\"texture\":4,\"drawable\":13,\"index\":2,\"pallette\":0,\"name\":\"hair\"},{\"type\":\"drawable\",\"texture\":7,\"drawable\":107,\"index\":3,\"pallette\":0,\"name\":\"torso\"},{\"type\":\"drawable\",\"texture\":1,\"drawable\":85,\"index\":4,\"pallette\":0,\"name\":\"legs\"},{\"type\":\"drawable\",\"texture\":2,\"drawable\":49,\"index\":5,\"pallette\":0,\"name\":\"hands\"},{\"type\":\"drawable\",\"texture\":17,\"drawable\":71,\"index\":6,\"pallette\":0,\"name\":\"feet\"},{\"type\":\"drawable\",\"texture\":3,\"drawable\":11,\"index\":7,\"pallette\":0,\"name\":\"necklace\"},{\"type\":\"drawable\",\"texture\":2,\"drawable\":32,\"index\":8,\"pallette\":0,\"name\":\"accessories1\"},{