(273, 'steam:11000010a8a94e6', 'John', 'Visser', '10/04/1982', 'John grew up in a  small country town with a  population of about 1500 people.long country roads and no traffic made for easing mastering of driving most any kind of vehicle.growing up in the woods also came with the benefit of learning how to handle a fire arm or two.when john was about 22 years old he met a man in town that talked of the big city and all the craziness that went on there.after spending a few days with the man and he saw what john could do he was offered a job in the big city of Los Santos.well why not john said lets give it a shot...', 'notset', '{}', -1, '{}', 0, 462, 5300, '1885233650', '[{\"index\":0,\"drawable\":0,\"pallette\":0,\"type\":\"drawable\",\"texture\":0,\"name\":\"head\"},{\"index\":1,\"drawable\":121,\"pallette\":0,\"type\":\"drawable\",\"texture\":0,\"name\":\"beard\"},{\"index\":2,\"drawable\":8,\"pallette\":2,\"type\":\"drawable\",\"texture\":2,\"name\":\"hair\"},{\"index\":3,\"drawable\":15,\"pallette\":0,\"type\":\"drawable\",\"texture\":0,\"name\":\"torso\"},{\"index\":4,\"drawable\":4,\"pallette\":0,\"type\":\"drawable\",\"texture\":0,\"name\":\"legs\"},{\"index\":5,\"drawable\":43,\"pallette\":0,\"type\":\"drawable\",\"texture\":0,\"name\":\"hands\"},{\"index\":6,\"drawable\":12,\"pallette\":14,\"type\":\"drawable\",\"texture\":14,\"name\":\"feet\"},{\"index\":7,\"drawable\":44,\"pallette\":0,\"type\":\"drawable\",\"texture\":0,\"name\":\"necklace\"},{\"index\":8,\"drawable\":15,\"pallette\":0,\"type\":\"drawable\",\"texture\":0,\"name\":\"accessories1\"},{\"index\":9,\"drawable\":21,\"pallette\":5,\"type\":\"drawable\",\"texture\":5,\"name\":\"accessories2\"},{\"index\":10,\"drawable\":17,\"pallette\":0,\"type\":\"drawable\",\"texture\":0,\"name\":\"decals/mask\"},{\"index\":11,\"drawable\":11,\"pallette\":0,\"type\":\"drawable\",\"texture\":0,\"name\":\"torso2\"},{\"prop\":-1,\"index\":0,\"type\":\"prop\",\"texture\":-1,\"name\":\"helmet\"},{\"prop\":-1,\"inde