(275, 'steam:1100001038a2c52', 'Ted', 'McFarlane', '10/09/1990', 'It all began in the year 1990 when I was born in a quiet village in the UK. My parents Charles McFarlane and Margaret McFarlane (née Jackson) were childhood sweethearts and have been married since 1987, this is where the fairytale ends. I was never really close to my Father, he was always more interested in playing Golf, spending time at his Office, or traveling with my Mother. As for my Mother, well let\'s just say she wasn\'t the most loving of parents, in fact I don\'t once ever remember her being proud of me for anything. I was pretty close to my cousin growing up but I was always jealous of his academic ability, he never had to work hard but always got good grades... me on the other hand, I had to work my butt off to even scrape by. Due to my slipping grades, my parents sent me to boarding school as a child and I\'ve never forgiven them for sending me away. I do have some fond memories of my childhood and I miss some of my friends, but I have decided to walk away from any inheritence and to make it on my own in a new part of the World.\n\nI traveled to Los Santos in early 2018 and have already had great success setting up my own mobile food business, \"Jacko\'s Tacos\" with my cousin where once a week we offer free Tacos to all Emergency Services personnel. I\'m not the kind of person to put all my eggs into one basket though, so I drive a taxi cab on the side, which is great for familiarising myself with Los Santos. Being an outgoing person should be real asset in familiarising myself with Los Santos and making new acquantances, god knows I\'ll need them if I\'m going to survive. Most importantly however, I\'ve always lived my life on the right side of the law, no matter how tough life gets or how desperate I am. It has always been a dream of mine to be a Police Officer, I still have hope that it may happen one day and I live my life to the motto \"never say never\"!', 'notset', '{}', -1, '{}', 