(366, 'steam:110000107feaf6b', 'Michael', 'Rodriguez', '07/04/94', 'Born in mexico, i was always destined to end up being an american..or so said my family. Being born on the fourth of july they always said i was just as american as can be, yet i was as far from being an american as possible. One day my family tucked me into a truck when i was a young boy and i wasn\'t retrieved until a day later or so it felt like. next think i knew i was in america and my life had began. i took time learning english and working under the job tables to survive, as i grew older i was able to get a green card and legally live in the US. \n\nAt tha point in time i decided to do what i could to take care of and provide as well as possible, go to school, then try to become a police officer, so here i am, one day at a time slowly achieving that goal.', 'notset', '{}', -1, '{}', 0, 181, 5200, '1885233650', '[{\"texture\":0,\"drawable\":33,\"pallette\":0,\"index\":0,\"type\":\"drawable\",\"name\":\"head\"},{\"texture\":0,\"drawable\":0,\"pallette\":0,\"index\":1,\"type\":\"drawable\",\"name\":\"beard\"},{\"texture\":4,\"drawable\":10,\"pallette\":0,\"index\":2,\"type\":\"drawable\",\"name\":\"hair\"},{\"texture\":0,\"drawable\":1,\"pallette\":0,\"index\":3,\"type\":\"drawable\",\"name\":\"torso\"},{\"texture\":0,\"drawable\":4,\"pallette\":0,\"index\":4,\"type\":\"drawable\",\"name\":\"legs\"},{\"texture\":0,\"drawable\":0,\"pallette\":0,\"index\":5,\"type\":\"drawable\",\"name\":\"hands\"},{\"texture\":0,\"drawable\":8,\"pallette\":0,\"index\":6,\"type\":\"drawable\",\"name\":\"feet\"},{\"texture\":0,\"drawable\":0,\"pallette\":0,\"index\":7,\"type\":\"drawable\",\"name\":\"necklace\"},{\"texture\":0,\"drawable\":2,\"pallette\":0,\"index\":8,\"type\":\"drawable\",\"name\":\"accessories1\"},{\"texture\":0,\"drawable\":0,\"pallette\":0,\"index\":9,\"type\":\"drawable\",\"name\":\"accessories2\"},{\"texture\":0,\"drawable\":0,\"pallette\":0,\"index\":10,\"type\":\"drawable\",\"name\":\"decal